<div id="pf1" class="pf w0 h0" data-page-no="1"><div class="pc pc1 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x1 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0">“PELAJARAN <span class="_ _0"></span>11 : KONFLIK YANG <span class="_ _0"></span>AKAN DATANG&quot; </div><div class="t m0 x2 h2 y2 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h2 y3 ff1 fs0 fc0 sc0 ls0 ws0">Sabat Sore, <span class="_ _0"></span>8 Juni </div><div class="t m0 x3 h3 y4 ff1 fs1 fc0 sc0 ls0 ws0">Teks Memori: </div><div class="t m0 x3 h4 y5 ff2 fs1 fc0 sc0 ls0 ws0">“Kuduskan mereka m<span class="_ _0"></span>elalui kebenaran-Mu: firman-Mu adalah <span class="_ _0"></span>kebenaran.” KJV — </div><div class="t m0 x3 h4 y6 ff2 fs1 fc0 sc0 ls0 ws0">Yohanes 17:17 </div><div class="t m0 x3 h4 y7 ff2 fs1 fc0 sc0 ls0 ws0">“Mereka yang mengh<span class="_ _0"></span>ormati Sabat A<span class="_ _0"></span>lkitab akan dikecam sebagai musuh<span class="_ _0"></span> hukum dan </div><div class="t m0 x3 h4 y8 ff2 fs1 fc0 sc0 ls0 ws0">ketertiban, <span class="_ _0"></span>karena melanggar batasan moral masyarakat, meny<span class="_ _0"></span>ebabkan anarki dan </div><div class="t m0 x3 h4 y9 ff2 fs1 fc0 sc0 ls0 ws0">korupsi, dan<span class="_ _0"></span> menyerukan penghakiman Tuhan atas<span class="_ _0"></span> bumi. Kehati-hatian mereka y<span class="_ _0"></span>ang </div><div class="t m0 x3 h4 ya ff2 fs1 fc0 sc0 ls0 ws0">teliti akan terlihat j<span class="_ _0"></span>elas dalam sifat keras kep<span class="_ _0"></span>ala, keras kepala, dan meremehkan<span class="_ _0"></span> </div><div class="t m0 x3 h4 yb ff2 fs1 fc0 sc0 ls0 ws0">wewenang. <span class="_ _0"></span>Mereka akan dituduh tidak puas terhadap<span class="_ _0"></span> pemerintah. Para pendeta yang </div><div class="t m0 x3 h4 yc ff2 fs1 fc0 sc0 ls0 ws0">menging<span class="_ _0"></span>kari kewajiban hukum ilahi akan menyam<span class="_ _0"></span>paikan dari mimbar tugas untuk </div><div class="t m0 x3 h4 yd ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>yerahkan ketaatan kepada otoritas sipil sebagaimana yang d<span class="_ _0"></span>itahbiskan oleh Allah. </div><div class="t m0 x3 h4 ye ff2 fs1 fc0 sc0 ls0 ws0">Di ruang legislatif dan penga<span class="_ _0"></span>dilan, para pemelihara pe<span class="_ _0"></span>rintah akan disalahartikan dan </div><div class="t m0 x3 h4 yf ff2 fs1 fc0 sc0 ls0 ws0">dikutuk. Ka<span class="_ _0"></span>ta-kata mereka akan diberi warna yang sa<span class="_ _0"></span>lah; konstruksi terburuk akan </div><div class="t m0 x3 h4 y10 ff2 fs1 fc0 sc0 ls0 ws0">diterapkan pada mot<span class="_ _0"></span>if mereka. GC 59<span class="_ _0"></span>2.1  </div><div class="t m0 x3 h4 y11 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y12 ff2 fs1 fc0 sc0 ls0 ws0">“Ketika gereja-ge<span class="_ _0"></span>reja Protestan menolak argumen-argum<span class="_ _0"></span>en yang jelas dan alkitabiah </div><div class="t m0 x3 h4 y13 ff2 fs1 fc0 sc0 ls0 ws0">dalam membela <span class="_ _0"></span>hukum Allah, mereka akan rindu untuk<span class="_ _0"></span> membungkam orang-orang </div><div class="t m0 x3 h4 y14 ff2 fs1 fc0 sc0 ls0 ws0">yang imannya tida<span class="_ _0"></span>k dapat mereka hancurkan oleh<span class="_ _0"></span> Alkitab. Meskipun me<span class="_ _0"></span>reka menutup </div><div class="t m0 x3 h4 y15 ff2 fs1 fc0 sc0 ls0 ws0">mata te<span class="_ _0"></span>rhadap fakta tersebut, mereka kini<span class="_ _0"></span> mengambil tindakan yang a<span class="_ _0"></span>kan berujung </div><div class="t m0 x3 h4 y16 ff2 fs1 fc0 sc0 ls0 ws0">pada penganiayaan terhadap<span class="_ _0"></span> orang-orang yang dengan<span class="_ _0"></span> sadar menolak melakukan apa </div><div class="t m0 x3 h4 y17 ff2 fs1 fc0 sc0 ls0 ws0">yang dilakukan o<span class="_ _0"></span>leh umat Kristiani lainnya, dan menga<span class="_ _0"></span>kui tuntutan Sabat Kep<span class="_ _0"></span>ausan. </div><div class="t m0 