<div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h4 y1c ff2 fs1 fc0 sc0 ls0 ws0">akan dipenuh<span class="_ _0"></span>i dengan tindakan yang menindas. Ko<span class="_ _0"></span>rupsi politik menghancurkan rasa </div><div class="t m0 x3 h4 y1d ff2 fs1 fc0 sc0 ls0 ws0">cinta akan kea<span class="_ _0"></span>dilan dan penghargaan terhadap kebe<span class="_ _0"></span>naran; dan bahkan di Amerika </div><div class="t m0 x3 h4 y1e ff2 fs1 fc0 sc0 ls0 ws0">yang merdeka, p<span class="_ _0"></span>ara penguasa dan pembuat undang-undan<span class="_ _0"></span>g, demi mendapatkan </div><div class="t m0 x3 h4 y1f ff2 fs1 fc0 sc0 ls0 ws0">dukungan publik, a<span class="_ _0"></span>kan menuruti permintaan mas<span class="_ _0"></span>yarakat akan undang-undang y<span class="_ _0"></span>ang </div><div class="t m0 x3 h4 y20 ff2 fs1 fc0 sc0 ls0 ws0">menegakkan pemel<span class="_ _0"></span>iharaan hari Minggu. Kebebasan hati nu<span class="_ _0"></span>rani, yang membutuhkan </div><div class="t m0 x3 h4 y21 ff2 fs1 fc0 sc0 ls0 ws0">pengorbanan yang <span class="_ _0"></span>begitu besar, tidak lagi dihormati. Dalam kon<span class="_ _0"></span>flik yang akan segera </div><div class="t m0 x3 h4 y22 ff2 fs1 fc0 sc0 ls0 ws0">terjadi, kita akan m<span class="_ _0"></span>elihat contoh perkataan nabi: &apos;Nag<span class="_ _0"></span>a itu murka terhadap <span class="_ _0"></span>perempuan </div><div class="t m0 x3 h4 y23 ff2 fs1 fc0 sc0 ls0 ws0">itu, dan pergi berperang <span class="_ _0"></span>dengan sisa keturunannya, yang menaati perintah<span class="_ _0"></span>-perintah </div><div class="t m0 x3 h4 y24 ff2 fs1 fc0 sc0 ls0 ws0">Allah, dan<span class="_ _0"></span> memiliki kesaksian tentang Yesus Kristus. ” Wa<span class="_ _0"></span>hyu 12:17.&apos;” Kejadi<span class="_ _0"></span>an 592.3 </div><div class="t m0 x3 h4 y25 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y26 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y27 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y28 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y29 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y2a ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y2b ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y2c ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y2d ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y2e ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y2f ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y30 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y31 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y32 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y33 ff2 fs1 fc0 sc0 ls0 ws0"> </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pf3" class="pf w0 h0" data-page-no="3"><div class="pc pc3 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0">Minggu,<span class="_ _0"></span> 9 Juni </div><div class="t m0 x3 h5 y34 ff1 fs2 fc0 sc0 ls0 ws0">Konflik Terakhir Wahyu<span class="_ _1"></span> </div><div class="t m0 x3 h6 y35 ff3 fs1 fc1 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y36 ff2 fs1 fc0 sc0 ls0 ws0">Bandingkan Wahyu<span class="_ _0"></span> 14:7, 9 dengan Wahyu 14:11. A<span class="_ _0"></span>pa tema utama<span class="_ _0"></span> kitab Wahyu dalam </div><div class="t m0 x3 h4 y37 ff2 fs1 fc0 sc0 ls0 ws0">konflik antara kebaikan da<span class="_ _0"></span>n kejahatan? </div><div class="t m0 x3 h4 y38 ff2 fs1 fc0 sc0 ls0 ws0">“Melalui malaikat pertama, manu<span class="_ _0"></span>sia dipanggil untuk “takut <span class="_ _0"></span>akan Tuhan dan memul<span class="_ _0"></span>iakan </div><div class="t m0 x3 h4 y39 ff2 fs1 fc0 sc0 ls0 ws0">Dia” dan menyemb<span class="_ _0"></span>ah Dia sebagai Pencipta langit da<span class="_ _0"></span>n bumi. Untuk me<span class="_ _0"></span>lakukan hal ini, </div><div class="t m0 x3 h4 y3a ff2 fs1 fc0 sc0 ls0 ws0">mereka harus mematuhi hu<span class="_ _0"></span>kum-Nya. Kata orang bijak: “Takutlah<span class="_ _0"></span> akan Tuhan dan </div><div class="t m0 x3 h4 y3b ff2 fs1 fc0 sc0 ls0 ws0">patuhi pe<span class="_ _0"></span>rintah-perintah-Nya, karena itulah<span class="_ _0"></span> kewajiban manusia.” Pengkhotb<span class="_ _0"></span>ah 12:13. </div><div class="t m0 x3 h4 y3c ff2 fs1 fc0 sc0 ls0 ws0">Tanpa ketaatan pada pe<span class="_ _0"></span>rintah-perintah-Nya, tidak ada <span class="_ _0"></span>ibadah yang menyenangkan </div><div class="t m0 x3 h4 y3d ff2 fs1 fc0 sc0 ls0 ws0">Tuhan. “Inilah kas<span class="_ _0"></span>ih Allah, yaitu bahwa kita menaat<span class="_ _0"></span>i perintah-perintah-Nya.” </div><div class="t m0 x3 h4 y3e ff2 fs1 fc0 sc0 ls0 ws0">“Barangsiapa memal<span class="_ _0"></span>ingkan telinganya da<span class="_ _0"></span>ri mendengarkan hukum, doanya pun adalah </div><div class="t m0 x3 h4 y3f ff2 fs1 fc0 sc0 ls0 ws0">kekejian.” 1 Yohanes 5:3;<span class="_ _0"></span> Amsal 28:9.” GC 436.1  </div><div class="t m0 x3 h4 y40 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y41 ff2 fs1 fc0 sc0 ls0 ws0">“Berbeda dengan mereka <span class="_ _0"></span>yang menaati perintah<span class="_ _0"></span>-perintah Allah dan beriman kepada </div><div class="t m0 x3 h4 y42 ff2 fs1 fc0 sc0 ls0 ws0">Yesus, malaikat <span class="_ _0"></span>ketiga menunjuk pada gol<span class="_ _0"></span>ongan lain, yang terhadap kesalahan-</div><div class="t m0 x3 h4 y43 ff2 fs1 fc0 sc0 ls0 ws0">kesalahannya dibe<span class="_ _0"></span>rikan peringatan yang khidmat dan menak<span class="_ _0"></span>utkan: “Jika ada o<span class="_ _0"></span>rang </div><div class="t m0 x3 h4 y44 ff2 fs1 fc0 sc0 ls0 ws0">yang menyembah<span class="_ _0"></span> binatang itu dan pa<span class="_ _0"></span>tungnya, dan menerima<span class="_ _0"></span> tandanya pada keningnya </div><div class="t m0 x3 h4 y45 ff2 fs1 fc0 sc0 ls0 ws0">atau pada tanganny<span class="_ _0"></span>a, maka orang itu akan minum<span class="_ _0"></span> anggur murka Allah.” Wah<span class="_ _0"></span>yu 14:9, </div><div class="t m0 x3 h4 y46 ff2 fs1 fc0 sc0 ls0 ws0">10. Penafsiran <span class="_ _0"></span>yang benar atas simbo<span class="_ _0"></span>l-simbol yang digunakan diperlukan untuk </div><div class="t m0 x3 h4 y47 ff2 fs1 fc0 sc0 ls0 ws0">memahami p<span class="_ _0"></span>esan ini. Apa yang dilambangkan dengan b<span class="_ _0"></span>inatang, gambar, dan tanda </div><div class="t m0 x3 h4 y48 ff2 fs1 fc0 sc0 ls0 ws0">itu?” GC 438.1  </div><div class="t m0 x3 h4 y49 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y4a ff2 fs1 fc0 sc0 ls0 ws0">“Dalam pasal 13 (ayat 1-10)<span class="_ _0"></span> digambarkan seekor binatang<span class="_ _0"></span> lain, “seperti macan tutul,” </div><div class="t m0 x3 h4 y4b ff2 fs1 fc0 sc0 ls0 ws0">yang kepadanya na<span class="_ _0"></span>ga itu memberikan “kekuasaannya,<span class="_ _0"></span> dan kedudukannya, serta </div><div class="t m0 x3 h4 y4c ff2 fs1 fc0 sc0 ls0 ws0">kekuasaannya yang besar.” S<span class="_ _0"></span>imbol ini, seperti yang di<span class="_ _0"></span>yakini sebagian besar umat </div><div class="t m0 x3 h4 y4d ff2 fs1 fc0 sc0 ls0 ws0">Protestan,<span class="_ _0"></span> melambangkan kepausan, yang menggan<span class="_ _0"></span>tikan kekuasaan, kedudukan, dan </div><div class="t m0 x3 h4 y4e ff2 fs1 fc0 sc0 ls0 ws0">otoritas yan<span class="_ _0"></span>g pernah dipegang oleh kekaisaran Romawi kuno. Mengen<span class="_ _0"></span>ai binatang yang </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pf4" class="pf w0 h0" data-page-no="4"><div class="pc pc4 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h4 y1c ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>yerupai macan tutul itu dinyatakan: “Kepadanya <span class="_ _0"></span>diberikan mulut yang penuh </div><div class="t m0 x3 h4 y1d ff2 fs1 fc0 sc0 ls0 ws0">kesombongan dan hujat...<span class="_ _0"></span>. Dan dia membuka mulutnya untuk mengh<span class="_ _0"></span>ujat Allah, untuk </div><div class="t m0 x3 h4 y1e ff2 fs1 fc0 sc0 ls0 ws0">menghujat nama<span class="_ _0"></span>-Nya, dan kemah-Nya, dan m<span class="_ _0"></span>ereka yang diam di surga. . Dan </div><div class="t m0 x3 h4 y1f ff2 fs1 fc0 sc0 ls0 ws0">diberikan kepadanya untuk be<span class="_ _0"></span>rperang melawan orang-orang <span class="_ _0"></span>kudus, dan untuk </div><div class="t m0 x3 h4 y20 ff2 fs1 fc0 sc0 ls0 ws0">mengalahkan mereka: dan kepad<span class="_ _0"></span>anya diberikan kuasa atas segala <span class="_ _0"></span>suku, bahasa, dan </div><div class="t m0 x3 h4 y21 ff2 fs1 fc0 sc0 ls0 ws0">bangsa.” Nubuatan ini, yan<span class="_ _0"></span>g hampir identik dengan gamba<span class="_ _0"></span>ran tanduk kecil di Daniel </div><div class="t m0 x3 h4 y22 ff2 fs1 fc0 sc0 ls0 ws0">pasal 7, tidak d<span class="_ _0"></span>iragukan lagi menun<span class="_ _0"></span>juk pada kepausan.” GC 439.1  </div><div class="t m0 x3 h4 y23 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y24 ff2 fs1 fc0 sc0 ls0 ws0">“Tetapi apak<span class="_ _0"></span>ah yang dimaksud dengan “gambar binatang <span class="_ _0"></span>itu”? dan bagaima<span class="_ _0"></span>na cara </div><div class="t m0 x3 h4 y4f ff2 fs1 fc0 sc0 ls0 ws0">pembentukannya?<span class="_ _0"></span> Patung itu dibuat oleh binata<span class="_ _0"></span>ng bertanduk dua, dan merup<span class="_ _0"></span>akan </div><div class="t m0 x3 h4 y50 ff2 fs1 fc0 sc0 ls0 ws0">patung bina<span class="_ _0"></span>tang yang pertama. Itu juga disebut patung binatang itu.<span class="_ _0"></span> Kemudi<span class="_ _0"></span>an untuk </div><div class="t m0 x3 h4 y51 ff2 fs1 fc0 sc0 ls0 ws0">mengetahui seperti apa <span class="_ _0"></span>patung itu dan ba<span class="_ _0"></span>gaimana pembentukann<span class="_ _0"></span>ya, kita harus </div><div class="t m0 x3 h4 y52 ff2 fs1 fc0 sc0 ls0 ws0">mempelajari ciri-ciri binata<span class="_ _0"></span>ng itu sendiri—kepausan. P<span class="_ _0"></span>asal 443.1 </div><div class="t m0 x3 h4 y53 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y54 ff2 fs1 fc0 sc0 ls0 ws0">“Ketika gereja m<span class="_ _0"></span>ula-mula menjadi rusak karena menyimpan<span class="_ _0"></span>g dari kesederhanaan Injil </div><div class="t m0 x3 h4 y55 ff2 fs1 fc0 sc0 ls0 ws0">dan mene<span class="_ _0"></span>rima upacara dan adat istiadat kaf<span class="_ _0"></span>ir, ia kehilangan Roh dan kuasa Allah; dan </div><div class="t m0 x3 h4 y56 ff2 fs1 fc0 sc0 ls0 ws0">untuk mengendalika<span class="_ _0"></span>n hati nurani masyarakat, di<span class="_ _0"></span>a mencari dukungan dar<span class="_ _0"></span>i kekuatan </div><div class="t m0 x3 h4 y57 ff2 fs1 fc0 sc0 ls0 ws0">sekuler. Hasiln<span class="_ _0"></span>ya adalah kepausan, sebuah gereja yang mengendalikan k<span class="_ _0"></span>ekuasaan </div><div class="t m0 x3 h4 y58 ff2 fs1 fc0 sc0 ls0 ws0">negara dan meng<span class="_ _0"></span>gunakannya untuk mencapai tujuannya sendiri,<span class="_ _0"></span> khususnya untuk </div><div class="t m0 x3 h4 y59 ff2 fs1 fc0 sc0 ls0 ws0">hukuman “se<span class="_ _0"></span>sat”. Agar Amerika Serikat dapa<span class="_ _0"></span>t membentuk patung binat<span class="_ _0"></span>ang itu, </div><div class="t m0 x3 h4 y5a ff2 fs1 fc0 sc0 ls0 ws0">kekuasaan agama harus m<span class="_ _0"></span>engendalikan pemerintahan s<span class="_ _0"></span>ipil sedemikian rupa sehingga </div><div class="t m0 x3 h4 y5b ff2 fs1 fc0 sc0 ls0 ws0">wewenang negara j<span class="_ _0"></span>uga akan digunakan oleh gereja untuk men<span class="_ _0"></span>capai tujuan-tujuannya </div><div class="t m0 x3 h4 y5c ff2 fs1 fc0 sc0 ls0 ws0">sendiri.” GC 443.2  </div><div class="t m0 x3 h4 y5d ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y5e ff2 fs1 fc0 sc0 ls0 ws0">“Ciri khusus dari b<span class="_ _0"></span>inatang itu, dan juga gam<span class="_ _0"></span>barannya, adalah pelangga<span class="_ _0"></span>ran terhadap </div><div class="t m0 x3 h4 y5f ff2 fs1 fc0 sc0 ls0 ws0">perintah-perintah <span class="_ _0"></span>Allah. Kata Daniel, tentang tanduk kecil, kepausan: “Dia akan ber<span class="_ _0"></span>pikir </div><div class="t m0 x3 h4 y60 ff2 fs1 fc0 sc0 ls0 ws0">untuk mengubah <span class="_ _0"></span>waktu dan hukum.” Daniel 7:25, RV Dan Paul<span class="_ _0"></span>us menyebut kuasa yang </div><div class="t m0 x3 h4 y61 ff2 fs1 fc0 sc0 ls0 ws0">sama sebagai “m<span class="_ _0"></span>anusia durhaka,” yang meninggikan di<span class="_ _0"></span>rinya sendiri di atas Allah. </div><div class="t m0 x3 h4 y62 ff2 fs1 fc0 sc0 ls0 ws0">Nubuatan <span class="_ _0"></span>yang satu merupakan pelengkap nubuatan yang l<span class="_ _0"></span>ain. Hanya dengan </div><div class="t m0 x3 h4 y63 ff2 fs1 fc0 sc0 ls0 ws0">mengubah hu<span class="_ _0"></span>kum Allah maka kepausan dapat meningg<span class="_ _0"></span>ikan dirinya di atas Allah; si<span class="_ _0"></span>apa </div><div class="t m0 x3 h4 y64 ff2 fs1 fc0 sc0 ls0 ws0">pun yang den<span class="_ _0"></span>gan pengertian menaati hukum yang telah diubah ak<span class="_ _0"></span>an memberikan </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pf5" class="pf w0 h0" data-page-no="5"><div class="pc pc5 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h4 y1c ff2 fs1 fc0 sc0 ls0 ws0">penghormatan <span class="_ _0"></span>tertinggi kepada kekuasaan yang melakukan p<span class="_ _0"></span>erubahan tersebut. </div><div class="t m0 x3 h4 y1d ff2 fs1 fc0 sc0 ls0 ws0">Tindakan kepatuhan <span class="_ _0"></span>terhadap hukum kepau<span class="_ _0"></span>san akan menjadi tanda kesetiaan<span class="_ _0"></span> kepada </div><div class="t m0 x3 h4 y1e ff2 fs1 fc0 sc0 ls0 ws0">paus menggantikan<span class="_ _0"></span> Tuhan. GC 446.1  </div><div class="t m0 x3 h4 y1f ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y20 ff2 fs1 fc0 sc0 ls0 ws0">“Sebagai t<span class="_ _0"></span>anda otoritas Gereja Katolik, pa<span class="_ _0"></span>ra <span class="_ _1"></span>penulis kep<span class="_ _0"></span>ausan mengutip “tindakan </div><div class="t m0 x3 h4 y21 ff2 fs1 fc0 sc0 ls0 ws0">mengubah ha<span class="_ _0"></span>ri Sabat menjadi hari Minggu, yang dibolehkan oleh <span class="_ _0"></span>kaum Protestan; ... </div><div class="t m0 x3 h4 y22 ff2 fs1 fc0 sc0 ls0 ws0">karena dengan memelihara hari Ming<span class="_ _0"></span>gu, mereka mengakui kuasa gereja untu<span class="_ _0"></span>k </div><div class="t m0 x3 h4 y23 ff2 fs1 fc0 sc0 ls0 ws0">menetapkan hari raya, dan<span class="_ _0"></span> memerintahkan mereka berada di ba<span class="_ _0"></span>wah dosa.”—Henry </div><div class="t m0 x3 h4 y24 ff2 fs1 fc0 sc0 ls0 ws0">Tuberville, An A<span class="_ _0"></span>bridgement of the Christian Doct<span class="_ _0"></span>rine, halaman 58. Lalu apa <span class="_ _0"></span>yang </div><div class="t m0 x3 h4 y4f ff2 fs1 fc0 sc0 ls0 ws0">dimaksud denga<span class="_ _0"></span>n perubahan hari Sabat, selain perubahan ha<span class="_ _0"></span>ri Sabat? tanda, atau </div><div class="t m0 x3 h4 y50 ff2 fs1 fc0 sc0 ls0 ws0">tanda, otoritas Ge<span class="_ _0"></span>reja Roma—&apos;tanda b<span class="_ _0"></span>inatang itu&apos;?” Pasal 448.1 </div><div class="t m0 x3 h4 y65 ff2 fs1 fc0 sc0 ls0 ws0">Baca Wahyu 12<span class="_ _0"></span>:17 dan Wahyu 14:12. B<span class="_ _0"></span>agaimana pemujaan terhadap Sa<span class="_ _0"></span>ng Pencipta </div><div class="t m0 x3 h4 y66 ff2 fs1 fc0 sc0 ls0 ws0">menemukan ek<span class="_ _0"></span>spresi akhirnya? </div><div class="t m0 x3 h4 y67 ff2 fs1 fc0 sc0 ls0 ws0">“Dalam Wahyu 14, m<span class="_ _0"></span>anusia dipanggil untu<span class="_ _0"></span>k menyembah Sang Pencipta; dan nubuatan </div><div class="t m0 x3 h4 y68 ff2 fs1 fc0 sc0 ls0 ws0">tersebut memperli<span class="_ _0"></span>hatkan suatu kelompok yang, seb<span class="_ _0"></span>agai hasil dari pekabaran rang<span class="_ _0"></span>kap </div><div class="t m0 x3 h4 y69 ff2 fs1 fc0 sc0 ls0 ws0">tiga, mena<span class="_ _0"></span>ati perintah-perintah Allah. Salah<span class="_ _0"></span> satu perintah ini menunjuk langsung </div><div class="t m0 x3 h4 y6a ff2 fs1 fc0 sc0 ls0 ws0">kepada Allah s<span class="_ _0"></span>ebagai Pencipta. Sila keempat menyatakan: “Hari<span class="_ _0"></span> ketujuh adalah hari </div><div class="t m0 x3 h4 y6b ff2 fs1 fc0 sc0 ls0 ws0">Sabat Tuhan, A<span class="_ _0"></span>llahmu: ... sebab enam hari lama<span class="_ _0"></span>nya Tuhan menjadikan <span class="_ _0"></span>langit dan bumi, </div><div class="t m0 x3 h4 y6c ff2 fs1 fc0 sc0 ls0 ws0">laut dan <span class="_ _0"></span>segala isinya, dan Ia beristirahat pada hari ketujuh; <span class="_ _0"></span>oleh karena itu Tuhan </div><div class="t m0 x3 h4 y6d ff2 fs1 fc0 sc0 ls0 ws0">memberkati hari Sabat, <span class="_ _0"></span>dan menguduskannya.” Ke<span class="_ _0"></span>luaran 20:10, 11. Mengenai hari </div><div class="t m0 x3 h4 y6e ff2 fs1 fc0 sc0 ls0 ws0">Sabat, T<span class="_ _0"></span>uhan berfirman lebih lanjut bahwa itu ad<span class="_ _0"></span>alah “suatu tanda, ... supaya kamu </div><div class="t m0 x3 h4 y6f ff2 fs1 fc0 sc0 ls0 ws0">mengetahui bahwa Akulah <span class="_ _0"></span>Tuhan, Allahmu.” Yehezkiel 20:<span class="_ _0"></span>20. Dan alasan yang </div><div class="t m0 x3 h4 y70 ff2 fs1 fc0 sc0 ls0 ws0">diberikan adalah<span class="_ _0"></span>: “Sebab enam hari lamany<span class="_ _0"></span>a Tuhan menjadikan langit dan bumi, dan<span class="_ _0"></span> </div><div class="t m0 x3 h4 y71 ff2 fs1 fc0 sc0 ls0 ws0">pada hari ketujuh Ia beristiraha<span class="_ _0"></span>t dan menyegarkan diri.” Kel<span class="_ _0"></span>uaran 31:17.” Pasal 437.1 </div><div class="t m0 x3 h4 y72 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y73 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y74 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h3 y75 ff1 fs1 fc0 sc0 ls0 ws0"> </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pf6" class="pf w0 h0" data-page-no="6"><div class="pc pc6 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0">Senin<span class="_ _0"></span>, 10 Juni </div><div class="t m0 x3 h5 y34 ff1 fs2 fc0 sc0 ls0 ws0">Krisis yang Akan <span class="_ _1"></span>Datang </div><div class="t m0 x3 h4 y35 ff2 fs1 fc0 sc0 ls0 ws0">Baca Yohane<span class="_ _0"></span>s 16;2, Matius 10;22, 2 Tim<span class="_ _0"></span>otius 3:12, dan 1 Petrus 4:12. <span class="_ _0"></span>Apa yang </div><div class="t m0 x3 h4 y76 ff2 fs1 fc0 sc0 ls0 ws0">dialami gereja Pe<span class="_ _0"></span>rjanjian Baru, dan bagaimana hal itu diter<span class="_ _0"></span>apkan pada gereja zaman </div><div class="t m0 x3 h4 y77 ff2 fs1 fc0 sc0 ls0 ws0">akhir Kristus? </div><div class="t m0 x3 h4 y78 ff2 fs1 fc0 sc0 ls0 ws0">“Ketika Yesus mengungkapka<span class="_ _0"></span>n kepada murid-murid-Nya nas<span class="_ _0"></span>ib Yerusalem dan </div><div class="t m0 x3 h4 y79 ff2 fs1 fc0 sc0 ls0 ws0">pemandanga<span class="_ _0"></span>n kedatangan Yesus yang kedua kali, D<span class="_ _0"></span>ia juga menubuatkan peng<span class="_ _0"></span>alaman </div><div class="t m0 x3 h4 y7a ff2 fs1 fc0 sc0 ls0 ws0">umat-Nya mulai dari s<span class="_ _0"></span>aat Dia diambil d<span class="_ _0"></span>ari mereka, hingga kedatangan<span class="_ _0"></span>-Nya kembali </div><div class="t m0 x3 h4 y7b ff2 fs1 fc0 sc0 ls0 ws0">dalam kuasa dan kemuliaan untuk pembebasan<span class="_ _0"></span> mereka. Dari Bu<span class="_ _0"></span>kit Zaitun Juruselamat </div><div class="t m0 x3 h4 y7c ff2 fs1 fc0 sc0 ls0 ws0">melihat badai yan<span class="_ _0"></span>g akan menimpa gereja para rasul; dan<span class="_ _0"></span> menembus lebih d<span class="_ _0"></span>alam ke </div><div class="t m0 x3 h4 y7d ff2 fs1 fc0 sc0 ls0 ws0">masa depan, ma<span class="_ _0"></span>ta-Nya melihat badai yang gana<span class="_ _0"></span>s dan sia-sia yang akan menimpa para </div><div class="t m0 x3 h4 y7e ff2 fs1 fc0 sc0 ls0 ws0">pengikut-Nya di zaman keg<span class="_ _0"></span>elapan dan penganiayaan<span class="_ _0"></span> yang akan datang. Dalam </div><div class="t m0 x3 h4 y7f ff2 fs1 fc0 sc0 ls0 ws0">beberapa ucapa<span class="_ _0"></span>n singkat yang sangat pent<span class="_ _0"></span>ing Dia menubuatkan bagian yang akan </div><div class="t m0 x3 h4 y80 ff2 fs1 fc0 sc0 ls0 ws0">dibagikan o<span class="_ _0"></span>leh para penguasa dunia ini kepada gereja T<span class="_ _0"></span>uhan. Matius 24:9, 21, 22. Pa<span class="_ _0"></span>ra </div><div class="t m0 x3 h4 y81 ff2 fs1 fc0 sc0 ls0 ws0">pengikut K<span class="_ _0"></span>ristus harus menempuh jalan penghinaan,<span class="_ _0"></span> celaan, dan penderitaan yang </div><div class="t m0 x3 h4 y82 ff2 fs1 fc0 sc0 ls0 ws0">sama seperti yang di<span class="_ _0"></span>lalui oleh Guru mereka. Pe<span class="_ _0"></span>rmusuhan yang muncul te<span class="_ _0"></span>rhadap </div><div class="t m0 x3 h4 y83 ff2 fs1 fc0 sc0 ls0 ws0">Penebus dunia akan dinyat<span class="_ _0"></span>akan terhadap semua <span class="_ _0"></span>orang yang percaya pada nama-<span class="_ _0"></span>Nya. </div><div class="t m0 x3 h4 y84 ff2 fs1 fc0 sc0 ls0 ws0">GC 39.1  </div><div class="t m0 x3 h4 y85 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y86 ff2 fs1 fc0 sc0 ls0 ws0">“Sejarah gereja mula-m<span class="_ _0"></span>ula memberi kesaksian tentang penggenapan<span class="_ _0"></span> perkataan </div><div class="t m0 x3 h4 y87 ff2 fs1 fc0 sc0 ls0 ws0">Juruselamat. Kua<span class="_ _0"></span>sa-kuasa bumi dan neraka men<span class="_ _0"></span>yusun diri mereka melawan K<span class="_ _0"></span>ristus </div><div class="t m0 x3 h4 y88 ff2 fs1 fc0 sc0 ls0 ws0">melalui pribad<span class="_ _0"></span>i para pengikut-Nya. Paganisme mempe<span class="_ _0"></span>rkirakan bahwa jika Injil menang, </div><div class="t m0 x3 h4 y89 ff2 fs1 fc0 sc0 ls0 ws0">kuil dan altarnya <span class="_ _0"></span>akan disapu bersih; oleh karena itu d<span class="_ _0"></span>ia mengerahkan pasukannya </div><div class="t m0 x3 h4 y8a ff2 fs1 fc0 sc0 ls0 ws0">untuk menghancurkan agama Krist<span class="_ _0"></span>en. Api penganiayaan pun ber<span class="_ _0"></span>kobar. Orang-orang </div><div class="t m0 x3 h4 y8b ff2 fs1 fc0 sc0 ls0 ws0">Kristen dilucuti dari harta<span class="_ _0"></span> benda mereka dan diusir dari rumah mereka. Mereka “tekun </div><div class="t m0 x3 h4 y8c ff2 fs1 fc0 sc0 ls0 ws0">menanggung<span class="_ _0"></span> penderitaan yang hebat.” Ibrani 10:32. M<span class="_ _0"></span>ereka ”mendapat cobaan be<span class="_ _0"></span>rupa </div><div class="t m0 x3 h4 y8d ff2 fs1 fc0 sc0 ls0 ws0">cemoohan dan pencamb<span class="_ _0"></span>ukan yang kejam, ya, t<span class="_ _0"></span>erlebih lagi dengan belenggu dan </div><div class="t m0 x3 h4 y8e ff2 fs1 fc0 sc0 ls0 ws0">pemenjaraan”. Ibrani<span class="_ _0"></span> 11:36. Banyak orang yang memeteraikan <span class="_ _0"></span>kesaksian mereka </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pf7" class="pf w0 h0" data-page-no="7"><div class="pc pc7 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h4 y1c ff2 fs1 fc0 sc0 ls0 ws0">dengan da<span class="_ _0"></span>rah mereka. Bangsawan dan budak, kaya dan miskin, t<span class="_ _0"></span>erpelajar dan bodoh, </div><div class="t m0 x3 h4 y1d ff2 fs1 fc0 sc0 ls0 ws0">sama-sama d<span class="_ _0"></span>ibunuh tanpa ampun.” GC 39.2  </div><div class="t m0 x3 h4 y1e ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y1f ff2 fs1 fc0 sc0 ls0 ws0">Jika kesengsaraan<span class="_ _0"></span> Matius [Mat. 24:21] terjadi da<span class="_ _0"></span>lam periode 1260 tahun suprem<span class="_ _0"></span>asi </div><div class="t m0 x3 h4 y20 ff2 fs1 fc0 sc0 ls0 ws0">kepausan, yang m<span class="_ _0"></span>erupakan peristiwa di masa lalu, dan masa kesusahan<span class="_ _0"></span>, yang </div><div class="t m0 x3 h4 y21 ff2 fs1 fc0 sc0 ls0 ws0">dinubuat<span class="_ _0"></span>kan oleh Daniel [Dan. 12:1], di ma<span class="_ _0"></span>sa depan, bagaimana saya b<span class="_ _0"></span>isa </div><div class="t m0 x3 h4 y22 ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>yelaraskan catatan Matius dengan catatan Daniel, karena<span class="_ _0"></span> Matius menulis bahwa </div><div class="t m0 x3 h4 y23 ff2 fs1 fc0 sc0 ls0 ws0">tidak akan ada kes<span class="_ _0"></span>engsaraan yang lebih besar da<span class="_ _0"></span>ripada yang terjadi pada <span class="_ _0"></span>tahun 538 </div><div class="t m0 x3 h4 y24 ff2 fs1 fc0 sc0 ls0 ws0">hingga 1798 M, s<span class="_ _0"></span>edangkan Daniel mengk<span class="_ _0"></span>laim bahwa masa kesusahan akan te<span class="_ _0"></span>rjadi. </div><div class="t m0 x3 h4 y4f ff2 fs1 fc0 sc0 ls0 ws0">lebih besar dari a<span class="_ _0"></span>pa pun &apos;sejak ada sebuah bangsa.&apos;&quot;  </div><div class="t m0 x3 h4 y50 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y51 ff2 fs1 fc0 sc0 ls0 ws0">Berbicara tentang kesen<span class="_ _0"></span>gsaraan, kata Kitab Suci: &quot;<span class="_ _0"></span>Jika waktunya tidak dipe<span class="_ _0"></span>rsingkat, </div><div class="t m0 x3 h4 y52 ff2 fs1 fc0 sc0 ls0 ws0">maka tidak ada<span class="_ _0"></span> yang dapat diselamatkan;&quot; yakni umat Allah s<span class="_ _0"></span>udah akan musnah </div><div class="t m0 x3 h4 y53 ff2 fs1 fc0 sc0 ls0 ws0">seluruhnya dari m<span class="_ _0"></span>uka bumi kalau saja bukan karena <span class="_ _0"></span>janji yang tidak pernah gaga<span class="_ _0"></span>l: </div><div class="t m0 x3 h4 y54 ff2 fs1 fc0 sc0 ls0 ws0">“Tetapi oleh karen<span class="_ _0"></span>a orang-orang pilihan, masa itu akan dipe<span class="_ _0"></span>rsingkat” (Mat. 24:22), </div><div class="t m0 x3 h4 y55 ff2 fs1 fc0 sc0 ls0 ws0">padahal pada waktun<span class="_ _0"></span>ya masalah Michael akan be<span class="_ _0"></span>rdiri untuk melepaskan setiap orang </div><div class="t m0 x3 h4 y56 ff2 fs1 fc0 sc0 ls0 ws0">yang akan &quot;ditemuk<span class="_ _0"></span>an tertulis dalam buku.&quot; Den<span class="_ _0"></span>gan kata lain, pada masa kesusahan,<span class="_ _0"></span> </div><div class="t m0 x3 h4 y57 ff2 fs1 fc0 sc0 ls0 ws0">orang-orang benar dibunuh d<span class="_ _0"></span>an orang-orang jahat dibeb<span class="_ _0"></span>askan, sedangkan pada ma<span class="_ _0"></span>sa </div><div class="t m0 x3 h4 y58 ff2 fs1 fc0 sc0 ls0 ws0">kesusahan orang-orang b<span class="_ _0"></span>enar akan dibebaskan dan orang-oran<span class="_ _0"></span>g jahat dibunuh. Oleh </div><div class="t m0 x3 h4 y59 ff2 fs1 fc0 sc0 ls0 ws0">karena itu, masa<span class="_ _0"></span> kesusahan besar dan masa kesusahan adalah dua p<span class="_ _0"></span>eristiwa yang luar </div><div class="t m0 x3 h4 y5a ff2 fs1 fc0 sc0 ls0 ws0">biasa, yang masing-masing mer<span class="_ _0"></span>upakan peristiwa terbesar sepan<span class="_ _0"></span>jang sejarah nubuatan </div><div class="t m0 x3 h4 y5b ff2 fs1 fc0 sc0 ls0 ws0">-- yang satu merupa<span class="_ _0"></span>kan peristiwa terbesar melawan<span class="_ _0"></span> orang benar dan satu lagi peristiwa </div><div class="t m0 x3 h4 y5c ff2 fs1 fc0 sc0 ls0 ws0">terbesar melawan orang <span class="_ _0"></span>fasik. Jadi kita melihat bahwa ba<span class="_ _0"></span>ik Matius maupun Daniel </div><div class="t m0 x3 h4 y5d ff2 fs1 fc0 sc0 ls0 ws0">benar -- me<span class="_ _0"></span>nunjukkan bahwa setiap peristiwa ad<span class="_ _0"></span>alah yang terbesar dari jenisnya.  </div><div class="t m0 x3 h4 y5e ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y5f ff2 fs1 fc0 sc0 ls0 ws0">Karena keseng<span class="_ _0"></span>saraan ini adalah yang terbesar “sejak p<span class="_ _0"></span>ermulaan dunia,” hal ini </div><div class="t m0 x3 h4 y60 ff2 fs1 fc0 sc0 ls0 ws0">menunjukkan bah<span class="_ _0"></span>wa belum pernah ada kes<span class="_ _0"></span>engsaraan yang sebesar yang terjadi<span class="_ _0"></span> </div><div class="t m0 x3 h4 y61 ff2 fs1 fc0 sc0 ls0 ws0">terhadap umat Allah seper<span class="_ _0"></span>ti yang terjadi pada per<span class="_ _0"></span>iode yang disebutkan di atas; dan </div><div class="t m0 x3 h4 y62 ff2 fs1 fc0 sc0 ls0 ws0">seperti yang Yes<span class="_ _0"></span>us katakan bahwa hal seperti itu tidak akan pernah te<span class="_ _0"></span>rjadi, Dia </div><div class="t m0 x3 h4 y63 ff2 fs1 fc0 sc0 ls0 ws0">meyakinkan kita bah<span class="_ _0"></span>wa Allah tidak akan membiarkan <span class="_ _0"></span>orang-orang jahat setelah tahun </div><div class="t m0 x3 h4 y64 ff2 fs1 fc0 sc0 ls0 ws0">1798 M, lagi-lagi “m<span class="_ _0"></span>enyingkirkan orang-orang kudus,” padahal masa kesukar<span class="_ _0"></span>an, kata </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pf8" class="pf w0 h0" data-page-no="8"><div class="pc pc8 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h4 y1c ff2 fs1 fc0 sc0 ls0 ws0">Daniel, adalah mas<span class="_ _0"></span>a yang paling be<span class="_ _0"></span>sar “sejak saat itu.” adalah sebuah bangsa&quot; yang<span class="_ _0"></span> </div><div class="t m0 x3 h4 y1d ff2 fs1 fc0 sc0 ls0 ws0">menunjukkan bah<span class="_ _0"></span>wa air bah itu bisa lebih be<span class="_ _0"></span>sar atau sama besarnya, juga b<span class="_ _0"></span>ahwa masa </div><div class="t m0 x3 h4 y1e ff2 fs1 fc0 sc0 ls0 ws0">kesusahan bisa <span class="_ _0"></span>saja diikuti oleh masa kesusahan<span class="_ _0"></span> yang lebih besar, karena Dia berkata,<span class="_ _0"></span> </div><div class="t m0 x3 h4 y1f ff2 fs1 fc0 sc0 ls0 ws0">&quot;bahkan sampa<span class="_ _0"></span>i waktu yang sama&quot;, &quot;tida<span class="_ _0"></span>k akan pernah terjadi lagi&quot;.  </div><div class="t m0 x3 h4 y8f ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y90 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y91 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y92 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y93 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y94 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y53 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y95 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y96 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y97 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y98 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y99 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y9a ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y9b ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y9c ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y9d ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y9e ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y9f ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 ya0 ff2 fs1 fc0 sc0 ls0 ws0"> </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pf9" class="pf w0 h0" data-page-no="9"><div class="pc pc9 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0">Selasa, 11 Jun<span class="_ _0"></span>i </div><div class="t m0 x3 h5 y34 ff1 fs2 fc0 sc0 ls0 ws0">Mengidentifikasi <span class="_ _1"></span>Binatang itu: Bagian <span class="_ _1"></span>1 </div><div class="t m0 x3 h7 ya1 ff3 fs3 fc1 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 ya2 ff2 fs1 fc0 sc0 ls0 ws0">Baca Wahyu 13<span class="_ _0"></span>:1, 2, 6. Dari manakah binatang ini munc<span class="_ _0"></span>ul, dan siapa yang membe<span class="_ _0"></span>rinya </div><div class="t m0 x3 h4 ya3 ff2 fs1 fc0 sc0 ls0 ws0">wewenang? Kata k<span class="_ _0"></span>unci apa yang digunakan untuk mengide<span class="_ _0"></span>ntifikasi kekuatan binatang? </div><div class="t m0 x3 h4 ya4 ff2 fs1 fc0 sc0 ls0 ws0">“Dalam pasal 13 (ayat 1-10)<span class="_ _0"></span> digambarkan seekor binatang<span class="_ _0"></span> lain, “seperti macan tutul,” </div><div class="t m0 x3 h4 ya5 ff2 fs1 fc0 sc0 ls0 ws0">yang kepadanya na<span class="_ _0"></span>ga itu memberikan “kekuasaannya,<span class="_ _0"></span> kedudukannya, dan </div><div class="t m0 x3 h4 ya6 ff2 fs1 fc0 sc0 ls0 ws0">kekuasaannya yang besar.” S<span class="_ _0"></span>imbol ini, seperti yang di<span class="_ _0"></span>yakini sebagian besar umat </div><div class="t m0 x3 h4 ya7 ff2 fs1 fc0 sc0 ls0 ws0">Protestan,<span class="_ _0"></span> melambangkan kepausan, yang menggan<span class="_ _0"></span>tikan kekuasaan, kedudukan, dan </div><div class="t m0 x3 h4 ya8 ff2 fs1 fc0 sc0 ls0 ws0">otoritas yan<span class="_ _0"></span>g pernah dipegang oleh kekaisaran Romawi kuno. Mengen<span class="_ _0"></span>ai binatang yang </div><div class="t m0 x3 h4 ya9 ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>yerupai macan tutul itu dinyatakan: “Kepadanya <span class="_ _0"></span>diberikan mulut yang penuh </div><div class="t m0 x3 h4 yaa ff2 fs1 fc0 sc0 ls0 ws0">kesombongan dan hujat...<span class="_ _0"></span>. Dan dia membuka mulutnya untuk mengh<span class="_ _0"></span>ujat Allah, untuk </div><div class="t m0 x3 h4 yab ff2 fs1 fc0 sc0 ls0 ws0">menghujat nama<span class="_ _0"></span>-Nya, dan kemah-Nya, dan m<span class="_ _0"></span>ereka yang diam di surga. . Dan </div><div class="t m0 x3 h4 yac ff2 fs1 fc0 sc0 ls0 ws0">diberikan kepadanya untuk be<span class="_ _0"></span>rperang melawan orang-orang <span class="_ _0"></span>kudus, dan untuk </div><div class="t m0 x3 h4 yad ff2 fs1 fc0 sc0 ls0 ws0">mengalahkan mereka: dan kepad<span class="_ _0"></span>anya diberikan kuasa atas segala <span class="_ _0"></span>suku, bahasa, dan </div><div class="t m0 x3 h4 yae ff2 fs1 fc0 sc0 ls0 ws0">bangsa.” Nubuatan ini, yan<span class="_ _0"></span>g hampir identik dengan gamba<span class="_ _0"></span>ran tanduk kecil di Daniel </div><div class="t m0 x3 h4 yaf ff2 fs1 fc0 sc0 ls0 ws0">pasal 7, tidak d<span class="_ _0"></span>iragukan lagi menun<span class="_ _0"></span>juk pada kepausan.” GC 439.1  </div><div class="t m0 x3 h4 yb0 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 yb1 ff2 fs1 fc0 sc0 ls0 ws0">“&apos;Kekuasaan dibe<span class="_ _0"></span>rikan kepadanya untuk melanjutkan empat puluh dua <span class="_ _0"></span>bulan.&apos; Dan, kata </div><div class="t m0 x3 h4 yb2 ff2 fs1 fc0 sc0 ls0 ws0">sang nab<span class="_ _0"></span>i, “Aku melihat salah satu kepalanya seperti terluk<span class="_ _0"></span>a hingga mati.” Dan lag<span class="_ _0"></span>i: </div><div class="t m0 x3 h4 yb3 ff2 fs1 fc0 sc0 ls0 ws0">“Siapa yang membaw<span class="_ _0"></span>a ke dalam pembuangan, <span class="_ _0"></span>ia akan masuk ke dalam pembuangan; </div><div class="t m0 x3 h4 yb4 ff2 fs1 fc0 sc0 ls0 ws0">siapa yang membunuh d<span class="_ _0"></span>engan pedang, harus dibunuh<span class="_ _0"></span> dengan pedang.” Empat pul<span class="_ _0"></span>uh </div><div class="t m0 x3 h4 yb5 ff2 fs1 fc0 sc0 ls0 ws0">dua bulan itu<span class="_ _0"></span> sama dengan “waktu dan masa-masa dan <span class="_ _0"></span>pembagian waktu,” t<span class="_ _0"></span>iga </div><div class="t m0 x3 h4 yb6 ff2 fs1 fc0 sc0 ls0 ws0">setengah tahun, atau 126<span class="_ _0"></span>0 hari, dalam Daniel 7—waktu di<span class="_ _0"></span> mana kuasa kepausan </div><div class="t m0 x3 h4 yb7 ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>indas umat Allah. Periode ini, sebagaimana disebu<span class="_ _0"></span>tkan dalam bab-bab </div><div class="t m0 x3 h4 y9f ff2 fs1 fc0 sc0 ls0 ws0">sebelumnya, dimu<span class="_ _0"></span>lai dengan supremasi kepausan, tahu<span class="_ _0"></span>n 538 M, dan berakhir pada </div><div class="t m0 x3 h4 yb8 ff2 fs1 fc0 sc0 ls0 ws0">tahun 1798. Pada saat itu <span class="_ _0"></span>paus ditawan oleh tentara P<span class="_ _0"></span>erancis, kekuasaan kepausan </div><div class="t m0 x3 h4 yb9 ff2 fs1 fc0 sc0 ls0 ws0">mendapat luka yang mem<span class="_ _0"></span>atikan, dan ramalannya ada<span class="_ _0"></span>lah digenapi, &apos;Siapa yang </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pfa" class="pf w0 h0" data-page-no="a"><div class="pc pca w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h4 y1c ff2 fs1 fc0 sc0 ls0 ws0">membawa ke da<span class="_ _0"></span>lam pembuangan, ia akan masuk ke d<span class="_ _0"></span>alam pembuangan.&apos;” GC 439<span class="_ _0"></span>.2  </div><div class="t m0 x3 h4 y1d ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y1e ff2 fs1 fc0 sc0 ls0 ws0">Sepuluh tanduk tak<span class="_ _0"></span> bermahkota pada binatang Daniel<span class="_ _0"></span> yang keempat melambangkan </div><div class="t m0 x3 h4 y1f ff2 fs1 fc0 sc0 ls0 ws0">raja-raja yang a<span class="_ _0"></span>kan bangkit dari Kekaisaran Romaw<span class="_ _0"></span>i, dan mahkota pada binatang<span class="_ _0"></span> yang </div><div class="t m0 x3 h4 y20 ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>yerupai macan tutul itu menunjukkan bahwa binatang melamban<span class="_ _0"></span>gkan periode di </div><div class="t m0 x3 h4 y21 ff2 fs1 fc0 sc0 ls0 ws0">mana raja-raja mengambil mahkota mereka<span class="_ _0"></span>, periode setelah disintegrasi K<span class="_ _0"></span>ekaisaran </div><div class="t m0 x3 h4 y22 ff2 fs1 fc0 sc0 ls0 ws0">Romawi Pagan.<span class="_ _0"></span>  </div><div class="t m0 x3 h4 y23 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y24 ff2 fs1 fc0 sc0 ls0 ws0">Lebih jauh lagi, binatang<span class="_ _0"></span> yang menyerupai macan tutul itu m<span class="_ _0"></span>enghujat Allah dan Kemah </div><div class="t m0 x3 h4 y4f ff2 fs1 fc0 sc0 ls0 ws0">Suci-Nya sama seper<span class="_ _0"></span>ti yang dilakukan oleh binatang <span class="_ _0"></span>keempat Daniel dalam fase </div><div class="t m0 x3 h4 y50 ff2 fs1 fc0 sc0 ls0 ws0">keduanya, Roma <span class="_ _0"></span>Gerejawi; yaitu “satu masa dan dua masa d<span class="_ _0"></span>an pembagian waktu” (3 </div><div class="t m0 x3 h4 y51 ff2 fs1 fc0 sc0 ls0 ws0">tahun 6 bu<span class="_ _0"></span>lan), empat puluh dua bulan. Maka jelaslah ba<span class="_ _0"></span>hwa binatang yang </div><div class="t m0 x3 h4 y52 ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>yerupai macan tutul itu memerintah secara bersamaan<span class="_ _0"></span> dengan binatang yang tidak </div><div class="t m0 x3 h4 y53 ff2 fs1 fc0 sc0 ls0 ws0">tergambarkan<span class="_ _0"></span> itu dalam fase keduanya, yaitu fa<span class="_ _0"></span>se si kepala tanduk kecil. Oleh karena </div><div class="t m0 x3 h4 y54 ff2 fs1 fc0 sc0 ls0 ws0">itu, luka mematikan pada<span class="_ _0"></span> makhluk mirip<span class="_ _0"></span> macan tutul tersebut melambang<span class="_ _0"></span>kan pukulan </div><div class="t m0 x3 h4 y55 ff2 fs1 fc0 sc0 ls0 ws0">mema<span class="_ _0"></span>tikan yang diterimanya dari Reformasi Protestan. Oleh <span class="_ _0"></span>karena itu, kepalanya </div><div class="t m0 x3 h4 y56 ff2 fs1 fc0 sc0 ls0 ws0">yang terluka melam<span class="_ _0"></span>bangkan kekuatan kepala tand<span class="_ _0"></span>uk (sebuah penggabungan kekuatan </div><div class="t m0 x3 h4 y57 ff2 fs1 fc0 sc0 ls0 ws0">sipil dan agama) da<span class="_ _0"></span>ri binatang Daniel yang dilepaskan <span class="_ _0"></span>dari kekuatan sipilnya – tanpa </div><div class="t m0 x3 h4 y58 ff2 fs1 fc0 sc0 ls0 ws0">tanduk. </div><div class="t m0 x3 h4 yba ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 ybb ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 ybc ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 ybd ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 ybe ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 ybf ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 yc0 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 yc1 ff2 fs1 fc0 sc0 ls0 ws0"> </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pfb" class="pf w0 h0" data-page-no="b"><div class="pc pcb w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0">Rabu, 12 Juni </div><div class="t m0 x3 h5 y34 ff1 fs2 fc0 sc0 ls0 ws0">Mengidentifikasi <span class="_ _1"></span>Binatang itu: Bagian <span class="_ _1"></span>2 </div><div class="t m0 x3 h7 ya1 ff3 fs3 fc1 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 ya2 ff2 fs1 fc0 sc0 ls0 ws0">Baca Wahyu 15<span class="_ _0"></span>:5. Tuliskan ciri pengenal ini pada kolom di ba<span class="_ _0"></span>wah ini. </div><div class="t m0 x3 h4 yc2 ff2 fs1 fc0 sc0 ls0 ws0">Sekarang, karena t<span class="_ _0"></span>anduk binatang Yohanes mel<span class="_ _0"></span>ambangkan bang<span class="_ _0"></span>sa-bangsa, dan </div><div class="t m0 x3 h4 ya4 ff2 fs1 fc0 sc0 ls0 ws0">kepalanya <span class="_ _0"></span>yang terluka melambangkan sebuah organ<span class="_ _0"></span>isasi keagamaan yang terpisah </div><div class="t m0 x3 h4 ya5 ff2 fs1 fc0 sc0 ls0 ws0">dari kekuasaan sipil,<span class="_ _0"></span> dan karena ketu<span class="_ _0"></span>juh kepalanya semuanya sama, kecuali luk<span class="_ _0"></span>a pada </div><div class="t m0 x3 h4 ya6 ff2 fs1 fc0 sc0 ls0 ws0">salah satu dari me<span class="_ _0"></span>reka, maka menjadi jelas bahwa <span class="_ _0"></span>kepala-kepala itu melambang<span class="_ _0"></span>kan </div><div class="t m0 x3 h4 ya7 ff2 fs1 fc0 sc0 ls0 ws0">bangsa-bangsa. , ber<span class="_ _0"></span>jumlah tujuh, menggambarkan <span class="_ _0"></span>badan-badan keagamaan, </div><div class="t m0 x3 h4 ya8 ff2 fs1 fc0 sc0 ls0 ws0">Susunan Kristen <span class="_ _0"></span>secara keseluruhan. Namun, tanduknya,<span class="_ _0"></span> berjumlah sepuluh, </div><div class="t m0 x3 h4 ya9 ff2 fs1 fc0 sc0 ls0 ws0">menggambarkan p<span class="_ _0"></span>emerintahan sipil secara keseluruhan. Oleh kar<span class="_ _0"></span>ena itu, baik tanduk </div><div class="t m0 x3 h4 yaa ff2 fs1 fc0 sc0 ls0 ws0">maupun kepala melambangk<span class="_ _0"></span>an dunia saat ini sama sepe<span class="_ _0"></span>rti masing-masing keempat<span class="_ _0"></span> </div><div class="t m0 x3 h4 yab ff2 fs1 fc0 sc0 ls0 ws0">binatang<span class="_ _0"></span> dalam Daniel melambangkan<span class="_ _0"></span> dunia pada zaman mereka.   </div><div class="t m0 x3 h4 yac ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 yad ff2 fs1 fc0 sc0 ls0 ws0">Tanduk-tanduk dan <span class="_ _0"></span>kepala-kepala itu semuanya ada pada b<span class="_ _0"></span>inatang itu pada saat yang </div><div class="t m0 x3 h4 yae ff2 fs1 fc0 sc0 ls0 ws0">bersamaan, <span class="_ _0"></span>tidak muncul satu demi satu, atau d<span class="_ _0"></span>engan cara yang sama te<span class="_ _0"></span>rjatuh seperti </div><div class="t m0 x3 h4 yaf ff2 fs1 fc0 sc0 ls0 ws0">tanduk-tanduk dal<span class="_ _0"></span>am Daniel pasal 7 dan 8, harus se<span class="_ _0"></span>lamanya meyakinkan setiap pikiran </div><div class="t m0 x3 h4 yb0 ff2 fs1 fc0 sc0 ls0 ws0">rasional bahwa tandu<span class="_ _0"></span>k-tanduk dan kepala-kepala itu <span class="_ _0"></span>melambangkan sipil. dan badan-</div><div class="t m0 x3 h4 yb1 ff2 fs1 fc0 sc0 ls0 ws0">badan keagamaan, s<span class="_ _0"></span>emuanya ada pada waktu yang <span class="_ _0"></span>sama, tidak ada yang mengikuti </div><div class="t m0 x3 h4 yb2 ff2 fs1 fc0 sc0 ls0 ws0">yang lain.  </div><div class="t m0 x3 h4 yb3 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 yb4 ff2 fs1 fc0 sc0 ls0 ws0">Penghujatan yang te<span class="_ _0"></span>rjadi di atas kepala, bukan di<span class="_ _0"></span> atas tanduk, menunjukkan bahwa </div><div class="t m0 x3 h4 yb5 ff2 fs1 fc0 sc0 ls0 ws0">badan-badan keagamaan<span class="_ _0"></span> yang digambarkan di dalamnya tidak menyembah <span class="_ _0"></span>Tuhan </div><div class="t m0 x3 h4 yb6 ff2 fs1 fc0 sc0 ls0 ws0">menurut Kebenaran,<span class="_ _0"></span> bahwa mereka tidak sepenuh<span class="_ _0"></span>nya seperti apa yang mereka akui. </div><div class="t m0 x3 h4 yb7 ff2 fs1 fc0 sc0 ls0 ws0">Penafsiran y<span class="_ _0"></span>ang tepat yang diberikan Ilham terhadap <span class="_ _0"></span>kata “penghujatan” ada<span class="_ _0"></span>lah </div><div class="t m0 x3 h4 y9f ff2 fs1 fc0 sc0 ls0 ws0">sebagai berikut: <span class="_ _0"></span>“Aku mengetahui penghujatan mereka yang mengata<span class="_ _0"></span>kan bahwa </div><div class="t m0 x3 h4 yb8 ff2 fs1 fc0 sc0 ls0 ws0">mereka adalah orang Yah<span class="_ _0"></span>udi, padahal sebenarnya mereka buka<span class="_ _0"></span>n.” Wahyu 2:9.<span class="_ _0"></span>  </div><div class="t m0 x3 h4 yb9 ff2 fs1 fc0 sc0 ls0 ws0"> </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pfc" class="pf w0 h0" data-page-no="c"><div class="pc pcc w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h4 y1c ff2 fs1 fc0 sc0 ls0 ws0">Lebih baik bag<span class="_ _0"></span>i kita semua untuk menga<span class="_ _0"></span>kui kegagalan kita daripada mengh<span class="_ _0"></span>indari </div><div class="t m0 x3 h4 y1d ff2 fs1 fc0 sc0 ls0 ws0">Kebenaran, k<span class="_ _0"></span>arena Kebenaran itulah <span class="_ _0"></span>yang akan memerdekakan kita.  </div><div class="t m0 x3 h4 y1e ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y1f ff2 fs1 fc0 sc0 ls0 ws0">Terlebih lagi, karena k<span class="_ _0"></span>ita mengakui bahwa Reformas<span class="_ _0"></span>i telah memberikan pukulan yang </div><div class="t m0 x3 h4 y20 ff2 fs1 fc0 sc0 ls0 ws0">mema<span class="_ _0"></span>tikan dan melahirkan Protestantisme, dan <span class="_ _0"></span>karena Ilham mengatakan <span class="_ _0"></span>bahwa luka </div><div class="t m0 x3 h4 y21 ff2 fs1 fc0 sc0 ls0 ws0">itu telah d<span class="_ _0"></span>isembuhkan, maka semua ini membukti<span class="_ _0"></span>kan sesuatu yang jika kita akui, d<span class="_ _0"></span>apat </div><div class="t m0 x3 h4 y22 ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>yelamatkan nyawa kita yang terancam, dan men<span class="_ _0"></span>jadikan kita sama besarnya </div><div class="t m0 x3 h4 y23 ff2 fs1 fc0 sc0 ls0 ws0">dengan orang-orang lain. P<span class="_ _0"></span>engakuan yang tulus p<span class="_ _0"></span>ada zaman dahulu membu<span class="_ _0"></span>at Daud </div><div class="t m0 x3 h4 y24 ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>jadi hebat. Apa yang harus kita akui? –<span class="_ _0"></span> Hanya ini: Jika Protestantisme melukai<span class="_ _0"></span> </div><div class="t m0 x3 h4 y4f ff2 fs1 fc0 sc0 ls0 ws0">binatang<span class="_ _0"></span> itu dengan Reformasi, maka penyembuhan <span class="_ _0"></span>luka tersebut menun<span class="_ _0"></span>jukkan bahwa </div><div class="t m0 x3 h4 y50 ff2 fs1 fc0 sc0 ls0 ws0">Reformasi telah gag<span class="_ _0"></span>al untuk menjaga luka tetap terbu<span class="_ _0"></span>ka, bahwa tujuan para <span class="_ _0"></span>reformis </div><div class="t m0 x3 h4 y51 ff2 fs1 fc0 sc0 ls0 ws0">telah mati, dan<span class="_ _0"></span> despotisme telah bangk<span class="_ _0"></span>it kembali. Memang benar, sim<span class="_ _0"></span>bolisme ini tidak </div><div class="t m0 x3 h4 y52 ff2 fs1 fc0 sc0 ls0 ws0">lebih dari pesan y<span class="_ _0"></span>ang disampaikan kepada orang-orang <span class="_ _0"></span>Laodikia:  </div><div class="t m0 x3 h4 y53 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y54 ff2 fs1 fc0 sc0 ls0 ws0">“Sebab katamu, aku ka<span class="_ _0"></span>ya, berlimpah harta, dan <span class="_ _0"></span>tidak kekurangan apa-apa; dan tidak<span class="_ _0"></span> </div><div class="t m0 x3 h4 y55 ff2 fs1 fc0 sc0 ls0 ws0">mengetahui bahwa kam<span class="_ _0"></span>u celaka, dan sengsara, dan m<span class="_ _0"></span>iskin, dan buta, dan t<span class="_ _0"></span>elanjang: </div><div class="t m0 x3 h4 y56 ff2 fs1 fc0 sc0 ls0 ws0">Aku menasihat<span class="_ _0"></span>i kamu untuk membeli dari-Ku emas yan<span class="_ _0"></span>g diuji dalam api, aga<span class="_ _0"></span>r kamu </div><div class="t m0 x3 h4 y57 ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>jadi kaya; dan pakaian putih, agar engkau d<span class="_ _0"></span>apat berpakaian, dan agar rasa ma<span class="_ _0"></span>lu </div><div class="t m0 x3 h4 y58 ff2 fs1 fc0 sc0 ls0 ws0">karena ketelanj<span class="_ _0"></span>anganmu tidak tampak; dan olesi matamu d<span class="_ _0"></span>engan salep mata, agar </div><div class="t m0 x3 h4 y59 ff2 fs1 fc0 sc0 ls0 ws0">engkau dapat melihat<span class="_ _0"></span>.” Wahyu 3:17, 18.  </div><div class="t m0 x3 h4 y5a ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y5b ff2 fs1 fc0 sc0 ls0 ws0">Seseorang yang berada <span class="_ _0"></span>dalam kondisi yang menyedihkan<span class="_ _0"></span> dan pada saat yang sama </div><div class="t m0 x3 h4 y5c ff2 fs1 fc0 sc0 ls0 ws0">berpendapat bahwa i<span class="_ _0"></span>a tidak membutuh<span class="_ _0"></span>kan apa-apa, sungguh merupakan penghujatan. </div><div class="t m0 x3 h4 yc3 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h2 yc4 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h2 yc5 ff1 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h2 yc6 ff1 fs0 fc0 sc0 ls0 ws0"> </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pfd" class="pf w0 h0" data-page-no="d"><div class="pc pcd w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0">Kamis, 13 Jun<span class="_ _0"></span>i </div><div class="t m0 x3 h5 y34 ff1 fs2 fc0 sc0 ls0 ws0">Binatang dari <span class="_ _1"></span>Bumi </div><div class="t m0 x3 h7 ya1 ff3 fs3 fc1 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 ya2 ff2 fs1 fc0 sc0 ls0 ws0">Baca Wahyu 13<span class="_ _0"></span>;11-18. Apa perbedaan binatang kedu<span class="_ _0"></span>a ini dengan binatang pertama di </div><div class="t m0 x3 h4 ya3 ff2 fs1 fc0 sc0 ls0 ws0">Wahyu 13? </div><div class="t m0 x3 h4 ya4 ff2 fs1 fc0 sc0 ls0 ws0">Berbeda dengan bi<span class="_ _0"></span>natang yang pertama, binatang y<span class="_ _0"></span>ang kedua berasal dari dalam bumi. </div><div class="t m0 x3 h4 ya5 ff2 fs1 fc0 sc0 ls0 ws0">Laut dan bumi jelas<span class="_ _0"></span> menunjuk pada dua lokasi berbeda. Kita tahu bahw<span class="_ _0"></span>a binatang-</div><div class="t m0 x3 h4 ya6 ff2 fs1 fc0 sc0 ls0 ws0">binatang<span class="_ _0"></span> dalam Daniel 7, dan binatang<span class="_ _0"></span>-binatang yang menyerupai macan tutul dalam </div><div class="t m0 x3 h4 ya7 ff2 fs1 fc0 sc0 ls0 ws0">Wahyu 13, binatang<span class="_ _0"></span>-binatang yang muncul dari dalam <span class="_ _0"></span>laut, semuanya berasal dari </div><div class="t m0 x3 h4 ya8 ff2 fs1 fc0 sc0 ls0 ws0">Negeri Lama, t<span class="_ _0"></span>anah dimana umat manusia berasal. Ya,<span class="_ _0"></span> “laut” memang tepat </div><div class="t m0 x3 h4 ya9 ff2 fs1 fc0 sc0 ls0 ws0">melambang<span class="_ _0"></span>kan Negeri Lama karena laut adalah gudangnya air, t<span class="_ _0"></span>empat asal mula air, </div><div class="t m0 x3 h4 yaa ff2 fs1 fc0 sc0 ls0 ws0">karena Negeri Lama ada<span class="_ _0"></span>lah tempat penyebaran um<span class="_ _0"></span>at manusia.  </div><div class="t m0 x3 h4 yab ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 yac ff2 fs1 fc0 sc0 ls0 ws0">Maka, kata “bum<span class="_ _0"></span>i” merujuk pada sebuah tempat yang jauh da<span class="_ _0"></span>ri “laut” dan kebalikan dari </div><div class="t m0 x3 h4 yad ff2 fs1 fc0 sc0 ls0 ws0">arti laut, – <span class="_ _0"></span>sebuah negara yang terdiri dari pend<span class="_ _0"></span>uduk yang berimigrasi dari tempat lai<span class="_ _0"></span>n. </div><div class="t m0 x3 h4 yae ff2 fs1 fc0 sc0 ls0 ws0">Satu-satun<span class="_ _0"></span>ya negara atau bangsa yang jauh dari Nega<span class="_ _0"></span>ra Lama dan sama </div><div class="t m0 x3 h4 yaf ff2 fs1 fc0 sc0 ls0 ws0">berpengaruhnya seperti yan<span class="_ _0"></span>g digambarkan dalam binatang be<span class="_ _0"></span>rtanduk dua ini yang </div><div class="t m0 x3 h4 yb0 ff2 fs1 fc0 sc0 ls0 ws0">mun<span class="_ _0"></span>cul setelah terbentuknya binatang yang mirip macan t<span class="_ _0"></span>utul, pada periode P<span class="_ _0"></span>rotestan, </div><div class="t m0 x3 h4 yb1 ff2 fs1 fc0 sc0 ls0 ws0">adalah Amerika<span class="_ _0"></span> Serikat. Terlebih lagi, Amerika S<span class="_ _0"></span>erikat sudah menjadi kekuatan dunia,<span class="_ _0"></span> </div><div class="t m0 x3 h4 yb2 ff2 fs1 fc0 sc0 ls0 ws0">sehingga kita t<span class="_ _0"></span>idak perlu menebak-nebak lagi. Dua tanduk b<span class="_ _0"></span>inatang itu menunjuk pada </div><div class="t m0 x3 h4 yb3 ff2 fs1 fc0 sc0 ls0 ws0">dua kekuatan po<span class="_ _0"></span>litik yang berkuasa – Demokrat dan <span class="_ _0"></span>Republik. Karakter mereka yang </div><div class="t m0 x3 h4 yb4 ff2 fs1 fc0 sc0 ls0 ws0">seperti anak domba mem<span class="_ _0"></span>berikan kesan polos, tidak berbahaya, dan suka be<span class="_ _0"></span>rmurah </div><div class="t m0 x3 h4 yb5 ff2 fs1 fc0 sc0 ls0 ws0">hati. Meskipun<span class="_ _0"></span> demikian, binatang yang berbicara seperti see<span class="_ _0"></span>kor naga menolak </div><div class="t m0 x3 h4 yb6 ff2 fs1 fc0 sc0 ls0 ws0">penampakan tanduknya yang s<span class="_ _0"></span>eperti anak domba.   </div><div class="t m0 x3 h4 yb7 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 y9f ff2 fs1 fc0 sc0 ls0 ws0">Binatang bertanduk dua itu men<span class="_ _0"></span>ggunakan segala kuasa yang dim<span class="_ _0"></span>iliki binatang pertama, </div><div class="t m0 x3 h4 yb8 ff2 fs1 fc0 sc0 ls0 ws0">yaitu binatang<span class="_ _0"></span> yang menyerupai macan tutul, dan sekal<span class="_ _0"></span>i lagi menunjukkan bahwa ia </div><div class="t m0 x3 h4 yb9 ff2 fs1 fc0 sc0 ls0 ws0">adalah kuasa du<span class="_ _0"></span>nia. Memang benar, dibutuhkan k<span class="_ _0"></span>ekuatan seperti itu untuk memaksa </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
<div id="pfe" class="pf w0 h0" data-page-no="e"><div class="pc pce w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h4 y1c ff2 fs1 fc0 sc0 ls0 ws0">seluruh pengh<span class="_ _0"></span>uni bumi untuk beribadah sesuai perintah<span class="_ _0"></span>nya, dan untuk menerapkan </div><div class="t m0 x3 h4 y1d ff2 fs1 fc0 sc0 ls0 ws0">pemerintahan ge<span class="_ _0"></span>reja dan negara yang sama ketinggalan z<span class="_ _0"></span>amannya dengan Abad </div><div class="t m0 x3 h4 y1e ff2 fs1 fc0 sc0 ls0 ws0">Pertengahan<span class="_ _0"></span> itu sendiri. Benar, dibutuhkan kekuatan <span class="_ _0"></span>sebesar itu untuk mempenga<span class="_ _0"></span>ruhi </div><div class="t m0 x3 h4 y1f ff2 fs1 fc0 sc0 ls0 ws0">dunia, kecuali mereka yang<span class="_ _0"></span> namanya tertulis dalam Kitab<span class="_ _0"></span> Kehidupan Anak D<span class="_ _0"></span>omba, </div><div class="t m0 x3 h4 y20 ff2 fs1 fc0 sc0 ls0 ws0">untuk tundu<span class="_ _0"></span>k padanya.  </div><div class="t m0 x3 h4 yc7 ff2 fs1 fc0 sc0 ls0 ws0">Baca Wahyu 13<span class="_ _0"></span>:11, 12. Perubahan apa yang Anda lihat<span class="_ _0"></span> pada binatang ini dan siapa </div><div class="t m0 x3 h4 yc8 ff2 fs1 fc0 sc0 ls0 ws0">yang dibicarakannya? </div><div class="t m0 x3 h4 yc9 ff2 fs1 fc0 sc0 ls0 ws0">“Tanduk sepert<span class="_ _0"></span>i anak domba dan suara naga pada <span class="_ _0"></span>simbol tersebut menunjukkan<span class="_ _0"></span> </div><div class="t m0 x3 h4 yca ff2 fs1 fc0 sc0 ls0 ws0">kontradiksi yang mencolok ant<span class="_ _0"></span>ara profesi dan praktik bang<span class="_ _0"></span>sa yang diwakilinya. </div><div class="t m0 x3 h4 ycb ff2 fs1 fc0 sc0 ls0 ws0">“Berbicaranya” sua<span class="_ _0"></span>tu bangsa adalah tindakan otorita<span class="_ _0"></span>s legislatif dan yudikatifnya. </div><div class="t m0 x3 h4 ycc ff2 fs1 fc0 sc0 ls0 ws0">Dengan tindak<span class="_ _0"></sp