<div id="pff" class="pf w0 h0" data-page-no="f"><div class="pc pcf w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x3 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0">Jumat, 14 Juni </div><div class="t m0 x3 h5 y34 ff1 fs2 fc0 sc0 ls0 ws0">Pemikiran Lebih La<span class="_ _1"></span>njut </div><div class="t m0 x3 h4 y35 ff2 fs1 fc0 sc0 ls0 ws0">“Setelah pe<span class="_ _0"></span>ringatan terhadap penyembahan binatang dan patungnya, <span class="_ _0"></span>nubuatan </div><div class="t m0 x3 h4 y76 ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>yatakan: “Inilah mereka yang menuruti perintah<span class="_ _0"></span>-perintah Allah dan iman kepada </div><div class="t m0 x3 h4 y77 ff2 fs1 fc0 sc0 ls0 ws0">Yesus.” Ka<span class="_ _0"></span>rena mereka yang menaati pe<span class="_ _0"></span>rintah-perintah Allah diposisikan berbe<span class="_ _0"></span>da </div><div class="t m0 x3 h4 yd4 ff2 fs1 fc0 sc0 ls0 ws0">dengan mereka <span class="_ _0"></span>yang menyembah binatang itu dan patungnya <span class="_ _0"></span>serta menerima </div><div class="t m0 x3 h4 yd5 ff2 fs1 fc0 sc0 ls0 ws0">tandanya, mak<span class="_ _0"></span>a menaati hukum Allah, di satu sisi, d<span class="_ _0"></span>an pelanggarannya, di sisi lain, </div><div class="t m0 x3 h4 yd6 ff2 fs1 fc0 sc0 ls0 ws0">akan menjadikan<span class="_ _0"></span> mereka yang melanggar hukum A<span class="_ _0"></span>llah. perbedaan ant<span class="_ _0"></span>ara penyembah </div><div class="t m0 x3 h4 yd7 ff2 fs1 fc0 sc0 ls0 ws0">Tuhan dan penyembah binata<span class="_ _0"></span>ng. GC 445.3  </div><div class="t m0 x3 h4 yd8 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 yd9 ff2 fs1 fc0 sc0 ls0 ws0">“Karakteristik khusus dari binatang it<span class="_ _0"></span>u, dan juga gambarann<span class="_ _0"></span>ya, adalah pelanggaran </div><div class="t m0 x3 h4 yda ff2 fs1 fc0 sc0 ls0 ws0">terhadap perintah-per<span class="_ _0"></span>intah Allah. Kata Daniel, tentang tan<span class="_ _0"></span>duk kecil, kepausan: “Dia </div><div class="t m0 x3 h4 ydb ff2 fs1 fc0 sc0 ls0 ws0">akan berpikir u<span class="_ _0"></span>ntuk mengubah waktu dan hukum.” Daniel 7:25, RV Dan<span class="_ _0"></span> Paulus </div><div class="t m0 x3 h4 ydc ff2 fs1 fc0 sc0 ls0 ws0">men<span class="_ _0"></span>yebut kuasa yang sama sebagai “manus<span class="_ _0"></span>ia durhaka,” yang meninggikan dirinya </div><div class="t m0 x3 h4 ydd ff2 fs1 fc0 sc0 ls0 ws0">sendiri di atas<span class="_ _0"></span> Allah. Nubuatan yang satu merup<span class="_ _0"></span>akan pelengkap nubuatan yang <span class="_ _0"></span>lain. </div><div class="t m0 x3 h4 yde ff2 fs1 fc0 sc0 ls0 ws0">Hanya dengan menguba<span class="_ _0"></span>h hukum Allah maka kepausan dapat meninggikan <span class="_ _0"></span>dirinya di </div><div class="t m0 x3 h4 ydf ff2 fs1 fc0 sc0 ls0 ws0">atas Allah; <span class="_ _0"></span>siapa pun yang dengan pengertian men<span class="_ _0"></span>aati hukum yang telah diubah akan </div><div class="t m0 x3 h4 ye0 ff2 fs1 fc0 sc0 ls0 ws0">memberikan pen<span class="_ _0"></span>ghormatan tertinggi kepada kekuasaan yang melakuk<span class="_ _0"></span>an perubahan </div><div class="t m0 x3 h4 ye1 ff2 fs1 fc0 sc0 ls0 ws0">tersebut. T<span class="_ _0"></span>indakan kepatuhan terhadap hukum kepausan<span class="_ _0"></span> akan menjadi tanda kesetiaa<span class="_ _0"></span>n </div><div class="t m0 x3 h4 ye2 ff2 fs1 fc0 sc0 ls0 ws0">kepada paus mengg<span class="_ _0"></span>antikan Tuhan.” GC 446.1  </div><div class="t m0 x3 h4 ye3 ff2 fs1 fc0 sc0 ls0 ws0"> </div><div class="t m0 x3 h4 ye4 ff2 fs1 fc0 sc0 ls0 ws0">“Sementara pa<span class="_ _0"></span>ra penyembah Tuhan secara khusus ak<span class="_ _0"></span>an dibedakan berdasarkan </div><div class="t m0 x3 h4 ye5 ff2 fs1 fc0 sc0 ls0 ws0">penghormatan mereka terhadap pe<span class="_ _0"></span>rintah keempat,—karena <span class="_ _0"></span>ini adalah tanda dari kuasa </div><div class="t m0 x3 h4 ye6 ff2 fs1 fc0 sc0 ls0 ws0">kreatif-Nya d<span class="_ _0"></span>an kesaksian klaim-Nya atas penghormatan dan penghor<span class="_ _0"></span>matan </div><div class="t m0 x3 h4 ye7 ff2 fs1 fc0 sc0 ls0 ws0">manusia,—para pen<span class="_ _0"></span>yembah binatang akan menjadi dibedakan oleh up<span class="_ _0"></span>aya mereka </div><div class="t m0 x3 h4 ye8 ff2 fs1 fc0 sc0 ls0 ws0">untuk meruntuhk<span class="_ _0"></span>an tugu peringatan Sang Pencipta, un<span class="_ _0"></span>tuk meninggikan institusi Roma.<span class="_ _0"></span> </div><div class="t m0 x3 h4 ye9 ff2 fs1 fc0 sc0 ls0 ws0">Atas nama hari Minggu <span class="_ _0"></span>itulah Paus pertama kali m<span class="_ _0"></span>enyatakan klaimnya yang aroga<span class="_ _0"></span>n </div><div class="t m0 x3 h4 yea ff2 fs1 fc0 sc0 ls0 ws0">(lihat Lampiran); d<span class="_ _0"></span>an upaya pertama merek<span class="_ _0"></span>a untuk menggunakan kekuasaan<span class="_ _0"></span> negara </div><div class="t m0 x3 h4 yc6 ff2 fs1 fc0 sc0 ls0 ws0">adalah dengan<span class="_ _0"></span> memaksakan perayaan hari Minggu sebagai “hari Tuhan<span class="_ _0"></span>.” Namun </div></div><div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div></div>
